INSERT INTO `tcsteps` (`id`, `step_number`, `actions`, `expected_results`, `active`, `execution_type`) VALUES
(14, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Ingresar el nombre de usuario y la contrase&ntilde;a en los campos </span></p>', '<p><a id="fck_paste_padding">﻿</a><span style="font-size: 14.6667px; white-space-collapse: preserve;">1. El nombre de usuario y la correctamente.</span></p>\r\n<div>&nbsp;</div>\r\n<p><a id="fck_paste_padding">﻿</a></p>', 1, 1),
(15, 2, '<p><span style="font-size: 14.6667px; white-space-collapse: preserve;">2. Hacer clic en el bot&oacute;n &quot;Iniciar Sesi&oacute;n&quot;.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2: El sistema redirige al usuario a la p&aacute;gina principal del Secretario Acad&eacute;mico.</span></p>', 1, 1),
(31, 1, '<p><a id="fck_paste_padding">﻿</a><span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Ingresar el nombre de usuario y la contrase&ntilde;a en los campos correspondientes.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1: El nombre de usuario y la contrase&ntilde;a se ingresan correctamente.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(32, 2, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2. Hacer clic en el bot&oacute;n &quot;Iniciar Sesi&oacute;n&quot;.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2: El sistema redirige al usuario a la p&aacute;gina principal del Secretario Acad&eacute;mico.</span></p>', 1, 1),
(35, 1, '<div>\r\n<div class="ewa-rteLine" style="font-size: 14.6667px; white-space-collapse: preserve;">1. Ingresar el nombre de usuario y la contrase&ntilde;a en los campos correspondientes.</div>\r\n<div>&nbsp;</div>\r\n</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1: El nombre de usuario y la contrase&ntilde;a se ingresan correctamente.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(36, 2, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2. Hacer clic en el bot&oacute;n &quot;Iniciar Sesi&oacute;n&quot;.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2: El sistema redirige al usuario a la p&aacute;gina principal del Administrador.</span></p>', 1, 1),
(41, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Navegar a &quot;Gestion de Certificaciones&quot;.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1.- Mostrar Buscador por codigo de alumno.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(42, 2, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2. Navegar a la certificacion solicitada (Modular, titulo, bachiller).</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2.- Mostrar buscador para cada tipo de certificaci&oacute;n</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(43, 3, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">3. Ingresar el codigo de alumno en el buscador</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">3.- Validar que sea tipo numerico  </span></p>', 1, 1),
(44, 4, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Hacer clic en Buscar</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4.-Se habilitara la opci&oacute;n &quot;Generar Certificado&quot;.</span></p>', 1, 1),
(48, 1, '<div class="ewa-rteLine" style="font-size: 14.6667px; white-space-collapse: preserve;">1. Navegar a &quot;Gesti&oacute;n de Certificaciones&quot;.</div>\r\n<div>&nbsp;</div>\r\n<p>&nbsp;</p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1: Se ha iniciado sesi&oacute;n como el Secretario Acad&eacute;mico con los permisos adecuados</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(49, 2, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2. Navegar a la certificaci&oacute;n solicitada (Modular, t&iacute;tulo, bachiller).</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2: Se ha navegado a la secci&oacute;n de gesti&oacute;n de certificaciones y se ha seleccionado el tipo de certificaci&oacute;n deseado.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(50, 3, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">3. Ingresar el c&oacute;digo de alumno en el buscador.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">3: Se ha ingresado el c&oacute;digo del estudiante en el buscador.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(51, 4, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Hacer clic en &quot;Buscar&quot;.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4: El sistema muestra un mensaje de error indicando que el c&oacute;digo de estudiante no existe en el sistema.</span></p>', 1, 1),
(54, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Navegar a &quot;Gesti&oacute;n de Certificaciones&quot;.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Paso 1: Se ha iniciado sesi&oacute;n como el Secretario Acad&eacute;mico con los permisos adecuados.</span></p>', 1, 1),
