(66, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Navegar a &quot;Gesti&oacute;n de Certificaciones&quot;.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1: Se ha iniciado sesi&oacute;n como el Secretario Acad&eacute;mico con los permisos adecuados.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
