(69, 4, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Hacer clic en &quot;Buscar&quot;.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4: El sistema muestra un mensaje de error indicando que el campo del c&oacute;digo de estudiante no puede estar vac&iacute;o.</span></p>', 1, 1),
(72, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Seleccionar el m&oacute;dulo &quot;Nombre del M&oacute;dulo&quot;.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1: Se ha seleccionado el m&oacute;dulo &quot;Nombre del M&oacute;dulo&quot;.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
