(76, 5, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">5. Ingresar los cr&eacute;ditos obtenidos: 30.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">5: Se han ingresado los cr&eacute;ditos obtenidos: 30.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(77, 6, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">6. Hacer clic en guardar.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">6: El sistema crea el certificado modular seg&uacute;n los modelos definidos por el estado peruano y muestra un mensaje de &eacute;xito.</span></p>', 1, 1),
(80, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Seleccionar el m&oacute;dulo: Campo en blanco.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Paso 1: El sistema muestra un mensaje de error indicando que el campo &quot;M&oacute;dulo&quot; no puede estar en blanco.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(81, 2, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2. Seleccionar la carrera profesional &quot;Nombre de la Carrera&quot;.</span></p>', '', 1, 1),
(82, 3, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">3. Ingresar la fecha de inicio: Campo en blanco.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Paso 3: El sistema muestra un mensaje de error indicando que el campo &quot;Fecha de Inicio&quot; no puede estar en blanco.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(83, 4, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Ingresar la fecha de t&eacute;rmino &quot;30/06/2023&quot;.</span></p>\r\n<div>&nbsp;</div>', '', 1, 1),
(84, 5, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">5. Ingresar los cr&eacute;ditos obtenidos: Campo en blanco.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Paso 5: El sistema muestra un mensaje de error indicando que el campo &quot;Cr&eacute;ditos Obtuvos&quot; no puede estar en blanco.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
