(168, 2, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">2. Buscar y seleccionar el certificado que ya tiene una firma cargada.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Paso 2: Se muestra detalles del certificado seleccionado.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
