(170, 4, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Seleccionar el nuevo archivo PDF v&aacute;lido con la firma actualizada.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Paso 4: valia que sea archivo PDF</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(171, 5, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">5. Confirmar la carga del nuevo archivo.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Paso 5: El sistema muestra un mensaje de exito en la actualizaci&oacute;n del documento.</span></p>', 1, 1),
(174, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. En el apartado de disponiblidad. Ingresar la fecha en la cual estara disponible.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Se muestra la fecha seleccionada.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
