(181, 4, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Confirmar la acci&oacute;n.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Se descargara el archivo completo el cual tiene los datos del estudiantes, credito, etc. Ademas el certificado se marcara como Entregado. y ya no se mostrara en certificados pendientes por entregar.</span></p>', 1, 1),
