(190, 3, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">3. Seleccionar el certificado.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">3. Se mostrara detalles el certificado.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(191, 4, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Seleccionar la opci&oacute;n generar duplicado.</span></p>\r\n<div>&nbsp;</div>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">4. Se le mostrara un modal para confirmar la acci&oacute;n.</span></p>\r\n<div>&nbsp;</div>', 1, 1),
(192, 5, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">5. Confirmar la acci&oacute;n.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">5. Se creara un nuevo registro en los cetificados. Ademas, mostrara una notificaci&oacute;n de exito.</span></p>', 1, 1),
