INSERT INTO `tcsteps` (`id`, `step_number`, `actions`, `expected_results`, `active`, `execution_type`) VALUES
(243, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema inicia una solicitud para obtener datos iniciales de estudiantes desde Lamb Acad&eacute;mico.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Se establece una conexi&oacute;n exitosa con Lamb Acad&eacute;mico.</span></p>', 1, 1),
(246, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema inicia una solicitud peri&oacute;dica para actualizar los datos de estudiantes desde Lamb Acad&eacute;mico.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Se establece una conexi&oacute;n exitosa con Lamb Acad&eacute;mico.</span></p>', 1, 1),
(249, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema obtiene datos de estudiantes desde Lamb Acad&eacute;mico.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Se verifica la integridad de los datos obtenidos para garantizar que est&eacute;n completos y precisos.</span></p>', 1, 1),
(252, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Un usuario no autorizado intenta acceder a datos de estudiantes sin permiso.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema detecta el intento de acceso no autorizado y niega el acceso. Se registra el incidente de seguridad.</span></p>', 1, 1),
(255, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Se comprueba que los datos personales est&eacute;n cifrados y protegidos mediante medidas de seguridad adecuadas.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Los datos personales se mantienen seguros y confidenciales, y solo son accesibles por usuarios autorizados.</span></p>', 1, 1),
(258, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Se revisan los registros de eventos de seguridad para asegurar que se est&eacute;n registrando de manera precisa y completa.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Los registros de eventos de seguridad son detallados, precisos y proporcionan informaci&oacute;n suficiente para su an&aacute;lisis y seguimiento.</span></p>', 1, 1),
(261, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Monitorear el sistema durante un per&iacute;odo prolongado de 24 horas, los 7 d&iacute;as de la semana, sin interrupciones.</span></p>', '<p>&nbsp;El sistema debe permanecer accesible y funcional en todo momento sin interrupciones no planificadas.</p>\r\n<div class="ewa-rteLine">&nbsp;</div>', 1, 1),
(264, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Simular una interrupci&oacute;n no planificada y observar si se generan alertas y notificaciones para el equipo de operaciones.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Deben generarse alertas y notificaciones en tiempo real cuando se detecta una interrupci&oacute;n no planificada. </span></p>', 1, 1),
(267, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Un usuario sin experiencia navega por la interfaz de usuario de manera aut&oacute;noma.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El usuario debe poder encontrar y acceder a las funciones y secciones del sistema de manera f&aacute;cil y sin confusi&oacute;n.</span></p>', 1, 1),
(270, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. Los usuarios seleccionados realizan tareas espec&iacute;ficas dentro de la interfaz de usuario y proporcionan retroalimentaci&oacute;n.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Los usuarios deben completar las tareas con &eacute;xito y ofrecer retroalimentaci&oacute;n positiva sobre la usabilidad de la interfaz.</span></p>', 1, 1),
(273, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Generar eventos de seguridad, como intentos de acceso no autorizados o cambios en la configuraci&oacute;n de seguridad.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema debe registrar eventos de seguridad con informaci&oacute;n detallada sobre el evento, la hora y las acciones realizadas.</span></p>', 1, 1),
(276, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Intentar acceder o modificar registros de eventos sin autorizaci&oacute;n.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema debe proteger los registros de eventos contra accesos no autorizados o modificaciones no autorizadas.</span></p>', 1, 1),
(279, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Realizar una serie de solicitudes de autenticaci&oacute;n de usuario y medir el tiempo de respuesta promedio.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El tiempo de respuesta promedio para las operaciones de autenticaci&oacute;n de usuario debe ser menor a 4 segundos bajo condiciones normales.</span></p>', 1, 1),
(282, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Simular una carga m&aacute;xima enviando solicitudes concurrentes de autenticaci&oacute;n de usuario y medir el tiempo de respuesta promedio.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El tiempo de respuesta promedio no debe superar los 4 segundos incluso bajo condiciones de carga m&aacute;xima.</span></p>', 1, 1);
