(251, 46, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Acceso no autorizado a datos de estudiantes: Verificar que el sistema impida el acceso no autorizado a la informaci&oacute;n de los estudiantes.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">1. La seguridad del sistema est&aacute; en funcionamiento y operativo.</span></p>', 2, 2, '2023-09-23 04:28:03', 2, '2023-09-22 23:28:21', 1, 1, 1),
(254, 47, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Protecci&oacute;n de informaci&oacute;n personal de estudiantes: Verificar la seguridad de los datos personales de los estudiantes almacenados.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema est&aacute; en funcionamiento y almacena datos personales de estudiantes. </span></p>', 2, 2, '2023-09-23 04:28:56', 2, '2023-09-22 23:29:16', 1, 1, 1),
(257, 48, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Seguimiento de eventos de seguridad: Verificar que el sistema registra adecuadamente eventos de seguridad para su posterior an&aacute;lisis.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema est&aacute; en funcionamiento y registra eventos de seguridad.</span></p>', 2, 2, '2023-09-23 04:29:45', 2, '2023-09-22 23:29:58', 1, 1, 1),
(260, 49, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Verificar disponibilidad continua: Comprobar que el sistema est&eacute; disponible las 24 horas, los 7 d&iacute;as de la semana.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema esta operativo</span></p>', 2, 2, '2023-09-23 04:30:29', 2, '2023-09-22 23:30:47', 1, 1, 1),
(263, 50, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Alertas y notificaciones de tiempo de inactividad: Verificar que se generen alertas en caso de inactividad no planificada.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema esta operativo</span></p>', 2, 2, '2023-09-23 04:31:25', 2, '2023-09-22 23:31:45', 1, 1, 1),
(266, 51, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Navegaci&oacute;n intuitiva: Verificar que los usuarios pueden navegar de manera intuitiva por la interfaz de usuario.</span></p>', '<p>&nbsp;1. El usuario ha iniciado sesi&oacute;n y tiene los permisos necesarios.</p>\r\n<div class="ewa-rteLine">&nbsp;</div>', 2, 2, '2023-09-23 04:32:22', 2, '2023-09-22 23:32:42', 1, 1, 1),
(269, 52, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Pruebas de usuarios: Realizar pruebas de usuarios con un grupo representativo para evaluar la usabilidad.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema est&aacute; en funcionamiento y accesible para los usuarios seleccionados.</span></p>', 2, 2, '2023-09-23 04:33:07', 2, '2023-09-22 23:33:20', 1, 1, 1),
(272, 53, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Registro de eventos de seguridad: Verificar que el sistema registre de manera detallada eventos de seguridad.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El usuario autorizado se encuentra en la secci&oacute;n de registro de eventos de seguridad</span></p>', 2, 2, '2023-09-23 04:33:51', 2, '2023-09-22 23:34:08', 1, 1, 1),
(275, 54, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Mantenimiento de registros: Verificar que los registros de eventos se mantengan de manera segura y no se modifiquen indebidamente.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">El sistema est&aacute; en funcionamiento y los registros de eventos est&aacute;n disponibles.</span></p>', 2, 2, '2023-09-23 04:34:32', 2, '2023-09-22 23:34:53', 1, 1, 1),
(278, 55, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Evaluaci&oacute;n del tiempo de respuesta promedio: Verificar que el tiempo de respuesta promedio sea menor a 4 segundos bajo condiciones normales.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Sistema est&aacute; en funcionamiento y operativo</span></p>', 2, 2, '2023-09-23 04:35:18', 2, '2023-09-22 23:35:33', 1, 1, 1),
(281, 56, 1, 1, 1, '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Evaluaci&oacute;n del tiempo de respuesta bajo carga m&aacute;xima: Verificar que el tiempo de respuesta no supere los 4 segundos bajo condiciones de carga m&aacute;xima.</span></p>', '<p>&nbsp;<span style="font-size: 14.6667px; white-space-collapse: preserve;">Se ha generado una carga m&aacute;xima simulada.</span></p>', 2, 2, '2023-09-23 04:36:01', 2, '2023-09-22 23:36:14', 1, 1, 1);
